import './TextTrackList.css'

import Track from '../Track/Track';

export function TrackList() {
  return (
    <div class="TrackList">
        {
          this.props.tracks.map(track => {
            return <Track track={track} key={track.id} />
          }) 
        }
    </div>
  )
}
